import React from "react";

function Contact() {
  return (
    <div className="flex h-36 items-center justify-around bg-basecolor px-3 text-basefont">
      <div>
        <h3 className="text-2xl font-bold ">Interest to Request Contact us</h3>
        <p className="text-[15px] font-bold text-slate-400">Sign up is easy just fill out to your email</p>
      </div>

      <div>
        <div className="flex">
          <input type="text" placeholder="Enter your email" className="p3 rounded-md px-3 py-2"></input>
          <button className=" bg-primary px-3 py-2 text-black">Notify me</button>
        </div>
        <p className="text-[15px] font-bold text-slate-400">Sign up is easy just fill out to your email</p>
      </div>
    </div>
  );
}

export default Contact;
